import './App.css';
import { RouterProvider,createBrowserRouter } from 'react-router-dom';


function App(){

  const route = createBrowserRouter([
    {
      path:"/",
      element:"Home Page",
    },
    {
      path:"/add",
      element:"User Add Page",
    },
    {
      path:"/edit",
      element:"Update User Page",
    },
  ])

  return(
    <div className="App">
      <RouterProvider router={route}>

      </RouterProvider>
    </div>
  );
}

export default App;
